import React from "react";
import "./EmpNameCard.css";
const EmpNameCard = () => {
  return (
    <div className="GridContainer">
      <img
        className="grid-image"
        src="../Assets/Images/avatar.png"
        alt="profile pic"
      ></img>
      <span className="grid-item-1">EmployeeName</span>
      <span className="grid-item-2">Uid : 00012</span>
      <span className="grid-item-3">Role: Developer</span>
    </div>
  );
};
export default EmpNameCard;
